import { Icon } from '../Icon/Icon';
import { Button, Text } from './FilterButton.styled';


export const FilterButton = (iconid, text, width, height) => {
    return (
        <Button>
        <Icon iconid={iconid} width={width=32} height={height=32} />
        <Text>{text}</Text>
      </Button>
    );
  };
